int KMP(string& S, string& pattern) {
    vector<int> pi = vector<int>(pattern.length());
    int count_finds = 0;
    pi[0] = 0;
    //Префикс функция 
    for (int i = 1, j = 0; i < pattern.length(); ++i) { 
        if (pattern[i] == pattern[j]) {
            pi[i] = j + 1;
            j++;
        }
        else if (j == 0) {
            pi[i] = 0;
        }
        else {
            j = pi[j - 1];
        }
    }
    int start = clock();
    //Поиск КМП
    int k = 0;
    int l = 0;
    for (int k = 0; k < S.length(); ) {

        if (S[k] == pattern[l]) {
            k++;
            l++;
            if (l == pattern.length()) {
                count_finds++;
            }
        }
        else if (l == 0) {
            k++;
            if (k == S.length()) {
                break;
            }
        }
        else {
            l = pi[l - 1];
        }
    }
    int end = clock();
    cout << "\n" << end - start << endl;
    return count_finds;
}
string translateFrom16_to2(string s) {
    string str = "";
    for (int i = 0; i < s.length(); i++) {
        if (s[i] == ':') {
            str += ':';
        }
        else {
            switch (s[i]) {
            case '0':
                str += "0000";
                break;
            case '1':
                str += "0001";
                break;
            case '2':
                str += "0010";
                break;
            case '3':
                str += "0011";
                break;
            case '4':
                str += "0100";
                break;
            case '5':
                str += "0101";
                break;
            case '6':
                str += "0110";
                break;
            case '7':
                str += "0111";
                break;
            case '8':
                str += "1000";
                break;
            case '9':
                str += "1001";
                break;
            case 'a':
                str += "1010";
                break;
            case 'b':
                str += "1011";
                break;
            case 'c':
                str += "1100";
                break;
            case 'd':
                str += "1101";
                break;
            case 'e':
                str += "1110";
                break;
            case 'f':
                str += "1111";
                break;

            }
        }

    }
    return str;

}
void replaceIPv6(string & str) {
    cmatch result;
    regex IPv6("(([0-9a-f]{1,4}:){7,7})([0-9a-f]){1,4}");
    while (regex_search(str.c_str(), result, IPv6)) {
        string n = (translateFrom16_to2(result[0]));
        str = regex_replace(str, IPv6, n, std::regex_constants::format_first_only);
    }
}

